import React from 'react';
import { useNavigate } from 'react-router-dom';

import backgroundimage from '../assets/landingbg.jpeg'
const styles = {
    container: {
        display: 'flex',
        height: '100%',
    },
    left: {
        width: '50%',
        backgroundImage: 'url(./assets/left-half.jpg)',
        cursor: 'pointer',
    },
    right: {
        width: '50%',
        backgroundImage: 'url(./assets/right-half.jpg)',
        cursor: 'pointer',
    },
};

const LandingBG = () => {
    const history = useNavigate();

    const handleShopClick = () => {
        history.push('/shop');
    };

    const handleAboutClick = () => {
        history.push('/about');
    };

    return(
        <div style={styles.container}>
            <div style={styles.left} onClick={handleShopClick} />
            <div style={styles.right} onClick={handleAboutClick} />
        </div>
    );
}


export default LandingBG;
